import React from 'react';

const Maps = () => {
  return(
    <iframe
  width="600"
  height="450"
  style="border:0"
  loading="lazy"
  allowfullscreen
  src="https://www.google.com/maps/embed/v1/place?key=AIzaSyCLf9v50uzGk6FkgjhrBp3pIbpjdJpWEDI &q=Space+Needle,Seattle+WA">
</iframe>
  );
}

export default Maps;
